// Modal.js
import React from 'react';
import './modal.css'; // Agar styling qo'shmoqchi bo'lsangiz

const Modal = ({ isOpen, onClose }) => {
  if (!isOpen) return null;

  return (
    <div className="modal-overlay">
      <div className="modal-content">
        <h1>Product Qo'shish</h1>

        <button onClick={onClose}><i class="fa-solid fa-xmark"></i></button>

             <form action="" method="post">
                <input type="text" placeholder="Name" name="name" required />
                <input type="number" placeholder="Price" name="price" required />
                <input type="oldprice" placeholder="Rasmi" required />
                <input type="text" placeholder="Qiymat" required />
             </form>
      </div>
    </div>
  );
};

export default Modal;
